    number: number; //金额
    text: string; //显示文字
  }
  const Card: React.FC<CardProps> = ({ number, text }) => {
    return (
      <div style={cardStyle.container}>
        <div style={cardStyle.containerLeft}>
          <p>{number}</p>
          <p>{text}</p>
        </div>
        <img src={Discount} alt="" />
      </div>
    );
  };

